    state={
        exhumationlist: JSON,
    }
    
    componentDidMount= () =>{
        //console.log(serverurl.backendadress);
        fetch(serverurl.backendadress+'/exhumation/listexumation')
        .then(response => response.json())
        .then(json =>{
             this.setState({exhumationlist: json})
        })
        
    }
    

 
    render(){
        
        const{exhumationlist}=this.state;
